(function(n){new Vue({el:"#app",data:{entity:pageObj.business,showError:!1},methods:{ret:function(){history.go(-1)},save:function(){var t=this.entity;if(!t.appId||!t.secret||!t.mchId||!t.mchKey){n.alert("请将信息填写完整");this.showError=!0;return}this.showError=!1;n.loading();axios.post("/business/savesmall",{id:this.entity.id,appId:this.entity.appId,secret:this.entity.secret,mchId:this.entity.mchId,mchKey:this.entity.mchKey,templateNotifyId:this.entity.templateNotifyId}).then(function(t){if(n.loaded(),!t.data.success){n.alert(t.data.msg);return}n.alert("保存成功","success")}).catch(function(t){n.loaded();n.alert(t)})}}})})(jQuery);